import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [apiResponse, setApiResponse] = useState([]);


  useEffect(() => {
    async function fetchData() {
      const result = await fetch("http://localhost:9000/getCountries");
      const text = await result.json();
      console.log(text[0].data);

      setApiResponse(text[0].data['agriculture_percent_of_gdp'])
    }
    fetchData();
  }, []);



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <select>{apiResponse.map(country => (
          <option key={country} value={country}>{country}</option>))}
        </select>
        <table className="table table-striped col-md-10">
          <thead>
            <tr>
              <th>Year</th>
              <th>Industry Gdp</th>
              <th>Agriculture Gdp</th>
              <th>Services Gdp</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>2</td>
              <td>3</td>
              <td>4</td>
            </tr>
          </tbody>
        </table>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
